use sp_keyring::AccountKeyring;
use substrate_api_client::{ compose_extrinsic, extrinsic::xt_primitives::UncheckedExtrinsicV4, Api, XtStatus,
}; fn main() { // instantiate an Api that connects to the given address let url = "127.0.0.1:9944"; // if no signer is set in the whole program, we need to give to Api a specific type instead of an associated type // as during compilation the type needs to be defined. let signer = AccountKeyring::Bob.pair(); // this defaults to use 127.0.0.1:9944 let api = Api::new(format!("ws://{}", url)).set_signer(signer.clone()); let bytes_to_add: Vec<u8> = vec![1, 2, 3, 4]; let xt: UncheckedExtrinsicV4<_> = compose_extrinsic!( api.clone(), "TemplateModule", "ipfs_add_bytes", bytes_to_add ); println!("Composed Extrinsic:\n {:?}\n", xt); let tx_hash = api .send_extrinsic(xt.hex_encode(), XtStatus::Finalized) .unwrap(); println!("Transaction got finalized. Hash: {:?}", tx_hash);
}

